(17, 'PISOS Y PAREDES', 'vistas/img/categorias/428.jpg', 'Todos los productos como cerámicas y porcelanatos de uso en pisos interiores y exteriores, algunos productos según preferencia del cliente pueden instalarse también en paredes.', 1, 'PISOS Y PAREDES', 1, '2024-04-17 19:42:03'),
(18, 'PAREDES Y FACHADAS', 'vistas/img/categorias/143.jpg', 'Todas las cerámicas o productos para uso o instalar solamente en paredes. ', 1, 'PAREDES Y FACHADAS', 1, '2022-07-15 15:28:07'),
(20, 'DECORADOS Y MALLAS', 'vistas/img/categorias/538.jpg', 'Todos los productos cerámicos, porcelánicos, murales y mallas, con: diseños, colores ,formas, imágenes, exclusivos que sirven para adornar , resaltar, combinar y embellecer los espacios.', 1, 'DECORADOS Y MALLAS', 1, '2022-07-15 15:44:27'),
(23, 'AREA DE BAÑOS', 'vistas/img/categorias/483.jpg', 'Todos los productos utilizados en el área de Baños: sanitarios, lavamanos, duchas, torre duchas , accesorios, hidromasajes, tinas, etc..', 1, 'AREA DE BAÑOS', 1, '2022-07-15 15:21:06'),
(24, 'MUEBLES CON LAVAMANOS, COCINAS, LAVADEROS, OTROS', 'vistas/img/categorias/636.jpg', 'Todos los muebles para Baños, Cocinas, lavaderos.', 1, 'MUEBLES CON LAVAMANOS, COCINAS, LAVADEROS, OTROS', 1, '2022-07-15 20:35:00'),
(28, 'GRIFERIAS', 'vistas/img/categorias/608.jpg', 'Todas las griferías, monomandos, llaves , etc...para lavamanos o lavaplatos .', 0, 'GRIFERIAS', 1, '2022-07-15 20:31:35'),
(30, 'AREA DE PISCINAS', 'vistas/img/categorias/pISCINA.jpg', 'Todos los productos aptos para ser instalados en el área de piscinas: cerámicas, porcelanatos, mallas, bordes, etc...', 1, 'AREA DE PISCINAS', 1, '2022-07-15 16:32:45'),
(31, 'MADERA PLASTICA', 'vistas/img/categorias/madera plastica.jpg', 'Todas los productos de madera plástica para pisos y paredes', 1, 'vistas/img/categorias/madera plastica.jpg', 1, '2022-07-15 16:35:43'),
(32, 'PEGANTES, BOQUILLAS Y MATERIALES DE INSTALACIÓN', 'vistas/img/categorias/pegantes.jpg', 'Pegantes, boquillas, accesorios y herramienta para instalación', 1, 'PEGANTES, BOQUILLAS Y MATERIALES DE INSTALACIÓN', 1, '2022-07-15 21:23:35'),
(33, 'PINTURAS Y ESTUCOS', 'vistas/img/categorias/PINTURA 111.jpg', 'Todas las pinturas y estucos', 1, 'vistas/img/categorias/PINTURA 111.jpg', 1, '2022-07-15 16:39:17'),
(34, 'SERVICIOS', 'vistas/img/categorias/Servicios.jpg', 'Servicios de instalación de productos, corte de cerámica y porcelanato,  y transporte', 1, 'vistas/img/categorias/Servicios.jpg', 1, '2022-07-15 16:41:50'),
(35, 'OTROS', 'vistas/img/categorias/ALICATE PARA NIVELACION-PISO.jpg', 'Todos los productos que no se encuentran categorizados ', 0, 'vistas/img/categorias/ALICATE PARA NIVELACION-PISO.jpg', 0, '2022-07-15 16:44:00'),
(36, 'OTROS', 'vistas/img/categorias/Boceles.jpg', 'Todo lo que no se incluye en los anteriores', 0, 'vistas/img/categorias/Boceles.jpg', 1, '2022-07-15 20:52:31');
